        for(let i=0; i<get.body.length; i++){ 
        if(get?.body[i].email === info.email || (!info.lastName || !info.email || !info.password) ){
            console.log("no puedes registrarte ya existe el correo")
            succes=false;
            setNoSame(true)
           return
            } else{
               succes=true
            }
           
    }

 if(succes ===true){
